  {
    img: 'https://uifaces.co/our-content/donated/KtCFjlD4.jpg',
    title: 'Arthur Stewart',
    featured: true,
  },
  {
    img: 'https://images.unsplash.com/photo-1543610892-0b1f7e6d8ac1?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=634&q=80',
    title: 'Hebe Harwood',
  },

];

const useStyles = makeStyles((theme) => ({
  root: {


    backgroundColor: theme.palette.background.paper,
  
  },
  gridList: {
    width: 1920,
    height: 800,

  },
  titleBar: {
    background:
      'linear-gradient(to top, rgba(0,0,0,0.7) 0%, rgba(0,0,0,0.3) 70%, rgba(0,0,0,0) 100%)',
  },

}));



  export default function Home() {
    const classes = useStyles();
  
    return(

      <div className={classes.root}>
      <GridList cellHeight={300}  spacing={10} cols={6} className={classes.gridList}>
        
        <GridListTile key="Subheader"  cols={6} style={{ height: 'auto' }}>
          <ListSubheader component="div"></ListSubheader>
        </GridListTile>
        {tileData.map((tile) => (
          <GridListTile key={tile.img}>
            <img src={tile.img} alt={tile.title} />
            <GridListTileBar
              title={tile.title}

            />
          </GridListTile>
        ))}

      </GridList>
      
    </div>
  );
}
